import React from "react";
import Navbar from "../components/Navbar";
import TeamImg from "../assets/team.jpg"; 

function Team() {
  return (
    <>
      <Navbar />
      <h1 style={{ textAlign: 'center', color: '#632020' }}>About us</h1>
      <p style={{textAlign:'center'}}>Our team is full of passionate people and ready to make your dream software come true</p>
      <div style={{ display: 'flex', justifyContent: 'flex-end' }}>
        <br></br>
        <br></br>
        <h2 style={{ marginRight: '500px', fontWeight:"bold" }}> Meet our team </h2>
        <img src={TeamImg} alt="Team" height="50%" width="50%"/>
        <Navbar/>

      </div>
    </>
  );
}

export default Team;
